import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
///////////////////////////////////////////////////////////////////////////////////////////////////
import Emptycart from "../isLoading/EmptyCart";
import { getItemsCart } from "../../../store/AxiosLibrary";
import { getDataProductCart } from "../../../features/dataUserCreateSlice";

import axios from "axios";

const Cart = () => {
  const dispatch = useDispatch();
  const data = useSelector((state) => state);

  useEffect(async () => {
    const _id = "6205174b62182fa9c020e3c1";
    const url = "http://localhost:5000/api/method/getItemsCart";
    // await axios
    //   .post(url, { _id: _id })
    //   .then((res) => console.log(res.data.cart));
    await dispatch(
      getItemsCart({ _id: _id }).then((res) => {
        const dataCart = res.data.cart;
        if (dataCart) {
          getDataProductCart(dataCart);
        }
      })
    );
  }, []);

  return (
    <div>
      <Emptycart />
    </div>
  );
};

export default Cart;
